import React, { useState, useEffect } from 'react';
import { Link } from 'react-router-dom';
import './HomeGarden.css';
import { customerAPI } from '../../utils/api';

const HomeGarden = () => {
  const [products, setProducts] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState('');

  useEffect(() => {
    const fetchProducts = async () => {
      try {
        setLoading(true);
        const response = await customerAPI.getAllProducts({ category: 'home_garden' });
        setProducts(response.data.products || []);
        setLoading(false);
      } catch (err) {
        console.error('Error fetching home & garden products:', err);
        setError('Failed to load products. Please try again later.');
        setLoading(false);
      }
    };

    fetchProducts();
  }, []);

  const addToCart = async (productId) => {
    try {
      const token = localStorage.getItem('customerToken');
      if (!token) {
        window.location.href = '/vendi/login';
        return;
      }

      await customerAPI.addToCart({ productId, quantity: 1 });
      alert('Product added to cart!');
    } catch (err) {
      console.error('Error adding to cart:', err);
      alert('Failed to add product to cart.');
    }
  };

  if (loading) {
    return (
      <div className="home-garden-container loading">
        <h2>Loading home & garden products...</h2>
      </div>
    );
  }

  return (
    <div className="home-garden-container">
      <header className="category-header">
        <h1>Home & Garden Collection</h1>
        <p>Make your living space more beautiful with our home & garden products</p>
      </header>

      <div className="breadcrumb">
        <Link to="/">Home</Link> &gt; <Link to="/vendi/all-products">Products</Link> &gt; Home & Garden
      </div>

      {error && <div className="error-message">{error}</div>}

      <div className="category-filters">
        <div className="filter-group">
          <label>Sort by:</label>
          <select>
            <option value="newest">Newest</option>
            <option value="price-low">Price: Low to High</option>
            <option value="price-high">Price: High to Low</option>
            <option value="popular">Most Popular</option>
          </select>
        </div>
      </div>

      <div className="products-grid">
        {products.length === 0 ? (
          <div className="no-products">
            <p>No home & garden products available at the moment.</p>
            <Link to="/vendi/all-products">Browse all products</Link>
          </div>
        ) : (
          products.map((product) => (
            <div className="product-card" key={product.product_id}>
              <div className="product-image">
                <img 
                  src={product.image_url || 'https://via.placeholder.com/200x200?text=Home+and+Garden'} 
                  alt={product.name} 
                />
              </div>
              <div className="product-info">
                <h3>{product.name}</h3>
                <p className="product-description">{product.description}</p>
                <p className="product-price">${parseFloat(product.price).toFixed(2)}</p>
                <div className="product-actions">
                  <Link to={`/vendi/product-details?id=${product.product_id}`}>
                    <button className="view-details-btn">View Details</button>
                  </Link>
                  <button 
                    className="add-to-cart-btn" 
                    onClick={() => addToCart(product.product_id)}
                  >
                    Add to Cart
                  </button>
                </div>
              </div>
            </div>
          ))
        )}
      </div>
    </div>
  );
};

export default HomeGarden;
